import React, { Component } from 'react'
import axios from "axios";
export default class Table extends Component {
    constructor(props) {
        super(props);
        this.state = {
            profiles : []
        }
    }

    componentDidMount = () => {
        axios.get('https://api.github.com/search/users', {
            params: {
              q: this.props.name
            }
          }).then(response => {
            this.setState({profiles : response.data.items})
          })
          .catch(function (error) {
            console.log(error);
          });
    }

    render() {

        return (
            <div>
                <table class="table">
                    <thead class="thead-dark">
                        <tr>
                            <th scope="col">ID</th>
                            <th scope="col">First</th>
                            <th scope="col">Last</th>
                            <th scope="col">Handle</th>
                        </tr>
                        </thead>
                        <tbody>
                        <tr>
                            <th scope="row">1</th>
                            <td>Mark</td>
                            <td>Otto</td>
                            <td>@mdo</td>
                        </tr>
                        <tr>
                            <th scope="row">2</th>
                            <td>Jacob</td>
                            <td>Thornton</td>
                            <td>@fat</td>
                        </tr>
                        <tr>
                            <th scope="row">3</th>
                            <td>Larry</td>
                            <td>the Bird</td>
                            <td>@twitter</td>
                        </tr>
                    </tbody>
                </table>
            </div>
        )
    }
}
